import Header from "../Components/Header";
import { SetTag } from "../Components/Tag";

export const AddPage = () => {
  return (
    <>
      <Header
        Title="할 일 추가하기"
        Subtext="태그와 작업을 마음껏 만들어 보세요!"
        setLocate={setLocate}
        locate={locate}
      />
      <SetTag />
    </>
  );
};
